import { useNavigate } from "react-router-dom";
import { Link } from "react-router-dom";

const About = (props) => {
  const navigate = useNavigate();
  console.log("input below");
  console.log(props.input[0]);
  return (
    <div className="containerDisp">
      <button onClick={() => navigate(-1)}><img src="../icons/arrow_back.svg" alt="back"/></button>
      <div className="data">
        <div className="potions box">
          <h2>Potions</h2>

        </div>
        <Link to="/spells">
        <div className="s box">
          <h2>Spells</h2>
        </div>
        </Link>
        <div className="wizards box">
          <h2>Wizards</h2>

        </div>
      </div>
    </div>
  );
};

export default About;
